import Text from '../data/home.json';

console.log(Text)

const Render = () => {
    return (
        <>
            <div class='container flex justify-content-center align-content-center'>
                <div className='rounded' style='max-width: 750px; background-color: white; padding: 3rem 0'>
                    <div className='mb-3 font-weight-bold' style='font-size: 40px;'>{Text.Title}</div>
                    <div style='font-size: 18px;'>{Text.Para}</div>
                </div>
            </div>
        </>
    )
}

export default Render
